import React, { Component } from 'react';
import '../css/main.css';

class ReportsRowNull extends Component {

    render() {
        return (
            <tr className="table__row--body" data-id={this.props.id}>
                <td className="table__cell table__cell--null" colSpan="3">
                    Отчетов не найдено
                </td>
            </tr>
        );
    }

}

export default ReportsRowNull;
